import { Box, Text, ScrollView, HStack, Pressable } from "native-base";
import React from "react";
import Colors from "../color";
import { Ionicons } from "@expo/vector-icons";

function ManageProductScreen({ navigation }) {
  return (
    <Box safeAreaTop flex={1} bg={Colors.white}>
      <HStack
        space={3}
        w="full"
        px={4}
        bg="#FFA500"
        py={3}
        alignItems="center"
        safeAreaTop
      >
        <Text bold fontSize={17} color="white">
          Quản lý tin đăng
        </Text>
      </HStack>
      <ScrollView showsVerticalScrollIndicator={false} py={3}>
        
      </ScrollView>
    </Box>
  );
}

export default ManageProductScreen;
